from System.IO import File, Path from System.Text.RegularExpressions import Regex, RegexOptions from System import Environment, PlatformID, String from TCAdmin.GameHosting.SDK import rconClient from TCAdmin.GameHosting.SDK import RCONGameType from TCAdmin.Interfaces.Server import ServiceStatus
inifile = Path.Combine(ThisService_RootDirectory, String.Format("serverconfigmain.xml"))
pattern="\"TelnetPassword\"[ \t]*value=[ \t]*[\"]?(?<TelnetPassword>([^\"\r\n])*)[\"]?" filecontents = File.ReadAllText(inifile) match = Regex.Match(filecontents, pattern, RegexOptions.IgnoreCase)
if match.Success : rconpass = match.Groups["TelnetPassword"].Value Script.WriteToConsole(String.Format("RCon password is: {0}", rconpass))
rconclient=rconClient() rconclient.GameType = RCONGameType.UnityTelnet rconclient.Server = ThisService_IpAddress rconclient.Port = ThisService_RConPort Script.WriteToConsole("Shutting down server...") rconclient.Send(None, None, rconpass, "shutdown") Script.WriteToConsole(String.Format("RCon Response: {0}", rconclient.ReadResponse())) Script.WriteToConsole("Done.")

